function antzone(name) {
	var names = {
		'css' : function() {
			return 'css';
		},
		'div' : function() {
			return 'div';
		},
		'json' : function() {
			return 'json';
		}
	};
	if ( typeof names[name] !== 'function') {
		return false;
	}
	return names[name]();
}

function _Random(start, end) {
	return Math.floor(Math.random() * (end - start) + start);
}

function _Num2Price(amount, digit) {
	var digit = arguments[1] ? arguments[1] : 2;
	//a1
	if (/^-?\d*\.$/.test(amount)) {
		return Number(amount).toFixed(digit);
	} else {
		return (!!(Number(amount) % 1)) ? (Number(amount)).toFixed(digit) : (Number(amount) / 100).toFixed(digit);
	}

}

Number.prototype._MoneyFormat = function(n, x, s, c) {
	// 12345678.9.format(2, 3, '.', ',');
	// // "12.345.678,90"
	// 123456.789.format(4, 4, ' ', ':');
	// // "12 3456:7890"
	// 12345678.9.format(0, 3, '-');
	// // "12-345-679"
	var re = '\\d(?=(\\d{' + (x || 3) + '})+' + (n > 0 ? '\\D' : '$') + ')',
	    num = this.toFixed(Math.max(0, ~~n));
	return ( c ? num.replace('.', c) : num).replace(new RegExp(re, 'g'), '$&' + (s || ','));
};

