function _pos_clock() {
	var tDate = new Date()
	$(".scan-tab-content .toolbarpane .pos-clock-time").text(_checkTime(tDate.getHours()) + ':' + _checkTime(tDate.getMinutes()));
	$(".scan-tab-content .toolbarpane .pos-clock-date").text(_checkTime(tDate.getFullYear()) + '/' + _checkTime((tDate.getMonth() + 1)) + '/' + _checkTime(tDate.getDate()));
};

function _checkTime(i) {
	if (i < 10) {
		i = "0" + i
	}
	return i;
};

