var oReceiptPrinter = {
	PrinterNumber : "",
	PrinterName : "",
	PaperWidth : "",
	PaperLength : "",
	DefaulPrinter : ""
};

function _SetPrinters() {
	if (isMobile.any() || ($(window).width() <= 1024)) {
		return false;
	}
	LODOP = getLodop();
	var oPrinterObj = {
		"orderID" : 12345,
		"shopperName" : "John Smith",
		"shopperEmail" : "johnsmith@example.com",
		"Printers" : [],
		"orderCompleted" : true
	};

	var iPrinterCount = LODOP.GET_PRINTER_COUNT();
	var temp = {
		PrinterNumber : "-1",
		PrinterName : LODOP.GET_PRINTER_NAME("-1:PrinterName"),
		PaperWidth : LODOP.GET_PRINTER_NAME("-1:PaperWidth"),
		PaperLength : LODOP.GET_PRINTER_NAME("-1:PaperLength"),
		DefaulPrinter : "yes"
	};
	oPrinterObj.Printers.push(temp);
	for (var i = 0; i < iPrinterCount; i++) {
		//push
		var temp = {
			PrinterNumber : i,
			PrinterName : LODOP.GET_PRINTER_NAME(i + ":PrinterName"),
			PaperWidth : LODOP.GET_PRINTER_NAME(i + ":PaperWidth"),
			PaperLength : LODOP.GET_PRINTER_NAME(i + ":PaperLength"),
			DefaulPrinter : "no"
		};
		oPrinterObj.Printers.push(temp);
	};

	var oPrinters = oPrinterObj.Printers;
	for (var i = 0; i < oPrinters.length; i++) {
		var oCur_Printer = oPrinters[i];
		if (oCur_Printer.PrinterName == "XP-80C") {
			oReceiptPrinter.PrinterNumber = oCur_Printer.PrinterNumber;
			oReceiptPrinter.PrinterName = oCur_Printer.PrinterName;
			oReceiptPrinter.PaperWidth = oCur_Printer.PaperWidth;
			oReceiptPrinter.PaperLength = oCur_Printer.PaperLength;
			oReceiptPrinter.DefaulPrinter = oCur_Printer.DefaulPrinter;
		}

	}

}

function Print6() {
	LODOP = getLodop();
	if (!LODOP.GET_PRINTER_COUNT()) {
		return false;
	}
	var iCount = LODOP.GET_PRINTER_COUNT();
	LODOP.PRINT_INIT("xerply pos receipt print");
	LODOP.SET_PRINT_PAGESIZE(3, oReceiptPrinter.PaperWidth, "", "");
	LODOP.SET_PRINTER_INDEXA(oReceiptPrinter.PrinterName);
	//
	LODOP.ADD_PRINT_HTM(0, 0, "114%", "100%", "<body>" + document.getElementById("print6").innerHTML + "</body>");
	LODOP.SET_PRINT_MODE("FULL_WIDTH_FOR_OVERFLOW", true);
	// 
	// LODOP.SET_PRINT_MODE("POS_BASEON_PAPER",true);
	LODOP.PRINT();
	LODOP.SET_PRINTER_INDEXA(oReceiptPrinter.PrinterName);
	strData = String.fromCharCode(27) + "@" + String.fromCharCode(29) + "V" + String.fromCharCode(0) + String.fromCharCode(66);
	LODOP.SET_PRINT_MODE("SEND_RAW_DATA_ENCODE", "UTF-8");
	LODOP.SEND_PRINT_RAWDATA(strData);
};


